INSERT INTO `componentproperty` VALUES ('Access','the way to access the LRU',''),('ADT','Additional Descriptive Text.',''),('ATA','Air Transport Association,Air Transport Association (ATA) chapter classification of the item.',''),('ATE','Automatic Test Equipment',''),('BFE','Buyer Furnished Equipment.\n1: Customer Originated Change (COC)\n2: Buyer Furnished Equipment (BFE)\n3: BFE & COC\n4: Airbus Contracted Supplier part (ACS)\n5: COC & ACS\n6: BFE & ACS\n7: COC & BFE & ACS\nblank: Seller Furnished Equipment',''),('Body photos','parts body photos',''),('Dimension','Dimension information',''),('ESS','Essentiality Code.Indicates a part\'s essentiality for technical aircraft dispatch:\n1  NO GO item\n2  GO IF item\n3  GO item',''),('FUN','Function description.',''),('INC','Interchangeability Code.\n1 One-way-interchangeability:The old part number may be used as a replacement only where the old part number was installed. The new part number is an acceptable replacement for either the old or new part number.\n2 Two-way-interchangeability:The old and new part numbers are both acceptable replacements for either the old or new part number.\n3 Non Interchangeable.\n4 Interchangeable as a set:The part may be one-way or two-way interchangeable as a set. Refer to the Interchangeability Condition Document (ICD).\n5 Qualified Interchangeability:One-way interchangeable parts may be conditionally two-way interchangeable. Non-interchangeable parts may be conditionally one-way or two-way interchangeable. Please refer to the ICD.\n6 Part reidentification:A new part number has been given to a part that is in no other way different from the original one. The parts are fully interchangeable.',''),('LRU Name','LRU Name',''),('LTM','Supplier Lead Time.The maximum number of calendar days required by the supplier after receipt of a purchase order to make shipment of the quantity ordered. ',''),('Man hours','MAN HOURs.Man hours to complete the work.',''),('MFR','Manufacturer Code,This manufacturer code identifies the manufacturer/supplier, government agency or other organisation controlling the design and part number assignment of the subject part.                                      ','超链接至供应商信息（列表2）'),('Mounting Type','Mounting Type.',''),('MSQ','Minimum Sales Quantity',''),('MST','Mean Shop Processing Time.It indicates the total number of calendar days from receipt of the part at the repair base until dispatch. This includes administration, handling, repair, test and other functions at the repair shop.',''),('MTBR','Mean Time Between Failures.',''),('MTBUR','Mean Time Between Unscheduled Removals.The value of an MTBUR defines the period after that an unscheduled removal of a part from an aircraft is expected. The MTBUR is a 6 digit figure in conjunction with two further data elements, the Time Cycle Code (TCC) and the Removal Rate Indicator (RRI).',''),('NHA 1','next higher assembly part number.',''),('NHA 2','next higher assembly part number.',''),('PNR','Part Number',''),('QPA','Quantity per Aircraft.The average quantity per aircraft of the units installed across the fleet.',''),('remov procedure','Removing and installing procedure.',''),('RFS','Reason for Selection.\n0: Not a potential spare\n1: Wear\n2: Maintenance Damage\n3: Loss\n4: Vibration\n5: Corrosion\n6: Deterioration\n7: Extreme Temperature\n8: Other\n9: Not an initial provisioning part',''),('RPN','Replacing Part Number.Subject part number is replaced by this part number.',''),('RRI','Removal Rate Indicator.Indicates the exponential factor to the power of ten applied to the Mean Time/Cycles, Time/Hours or Time/Landings Between Unscheduled Removals (i.e., MTBUR x 10^RRI).',''),('SCR','Scrap Rate.Identifies the percentage (to one decimal place) of the units removed from service which are expected to be scrapped. For example, \'999\' in the RSPL corresponds to 99.9%.',''),('SPC','Spare Class Code.Indicates the classification of the spare part as follows:\n0 Reference item;\n1 Expendable;\n2 Repairable with dedicated CMM;\n6 Repairable without dedicated CMM.',''),('TCC','Time Cycle Code.Indicates that the MTBUR is shown in:\nH Hours\nC Cycles\nL Landings',''),('TPC','Technical Publication Code. TPC references are as follows:ACMM（Abbreviated Component Maintenance Manual）、CMM（Component Maintenance Manual）、CMS（Component Maintenance Sheet）、IM(Installation Manual)、IPC(Illustrated Parts Catalogue)、MM(Maintenance Manual)、OM(Overhaul Manual)、TDS(Technical Data Sheet)、NONE（No Technical Publication Code）',''),('UNP','Unit Price (in USD).',''),('Weight','Weight information',''),('ZONE','Installation location information',''),('ZONE photos','the photo of the zone which the LRU installation','');
/*!40000 ALTER TABLE `componentproperty` ENABLE KEYS */;
